function addChildren(a,b){b.forEach(b=>a.appendChild(b))}function removeChild(a){a.querySelectorAll("*").forEach(a=>a.remove())}function encodeString(b){var c="";b.toString();for(var d=0;d<b.length;d++){var e=b.charCodeAt(d);c+=String.fromCharCode(69^e)}return c}function numberWithCommas(a){return a.toString().replace(/\B(?=(\d{3})+(?!\d))/g,",")}function serialize(a){var b=[];for(var c in a)a.hasOwnProperty(c)&&b.push(encodeURIComponent(c)+"="+encodeURIComponent(a[c]));return b.join("&")}